// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.28;

import {HashLib} from "./libraries/HashLib.sol";
import {IBlueprint} from "./interfaces/IBlueprint.sol";
import {IBlueprintManager, TokenOp, BlueprintCall} from "./interfaces/IBlueprintManager.sol";
import {FlashAccounting, FlashSession, MainClue, FlashUserSession, UserClue} from "./FlashAccounting.sol";

contract BlueprintManager is IBlueprintManager, FlashAccounting {
    error InvalidChecksum();
    error AccessDenied();

    /// @notice eip-6909 operator mapping
    mapping(address => mapping(address => bool)) public isOperator;
    /// @notice eip-6909 balance mapping
    mapping(address => mapping(uint256 => uint256[2])) public balanceOf;
    /// @notice eip-6909 allowance mapping
    mapping(address => mapping(address => mapping(uint256 => uint256)))
        public allowance;

    mapping(uint256 => uint256) public tokenStorage; // tokenId => packedData

    /// @notice Emitted when tokens are minted
    event Mint(address indexed to, uint256 indexed id, uint256 amount);

    /// @notice Emitted when tokens are burned
    event Burn(address indexed from, uint256 indexed id, uint256 amount);

    /// @notice Emitted when tokens are transferred
    event Transfer(
        address indexed from,
        address indexed to,
        uint256 indexed id,
        uint256 amount
    );

    /// @notice Emitted when approval is given
    event Approval(
        address indexed owner,
        address indexed spender,
        uint256 indexed id,
        uint256 amount
    );

    /// @notice Emitted when an operator is set
    event OperatorSet(
        address indexed owner,
        address indexed operator,
        bool approved
    );

    function _mint(address to, uint256 id, uint256 amount) internal override {
        uint256 packedData = tokenStorage[id];
        uint256 newAmount = amount + (packedData & ((1 << 255) - 1)); // Extract current amount
        tokenStorage[id] = (packedData & (1 << 255)) | newAmount; // Update packed data
        emit Mint(to, id, amount);
    }

    function _burn(address from, uint256 id, uint256 amount) internal override {
        uint256 packedData = tokenStorage[id];
        uint256 currentAmount = packedData & ((1 << 255) - 1); // Extract current amount
        require(currentAmount >= amount, "Insufficient balance");
        uint256 newAmount = currentAmount - amount;
        tokenStorage[id] = (packedData & (1 << 255)) | newAmount; // Update packed data
        emit Burn(from, id, amount);
    }

    function _transferFrom(
        address from,
        address to,
        uint256 id,
        uint256 amount
    ) internal {
        _burn(from, id, amount);
        _mint(to, id, amount);
        emit Transfer(from, to, id, amount);
    }

    function _decreaseApproval(
        address sender,
        uint256 id,
        uint256 amount
    ) internal {
        uint256 allowed = allowance[sender][msg.sender][id];
        if (allowed != type(uint256).max)
            allowance[sender][msg.sender][id] = allowed - amount;
    }

    /**
     * @notice transfers `amount` of token `id` to `receiver`
     * @dev reverts on failure
     * @return is always true if didn't revert
     */
    function transfer(
        address receiver,
        uint256 id,
        uint256 amount
    ) public virtual returns (bool) {
        _transferFrom(msg.sender, receiver, id, amount);

        return true;
    }

    function transferFrom(
        address sender,
        address receiver,
        uint256 id,
        uint256 amount
    ) public virtual returns (bool) {
        if (msg.sender != sender && !isOperator[sender][msg.sender])
            _decreaseApproval(sender, id, amount);

        _transferFrom(sender, receiver, id, amount);

        return true;
    }

    function approve(
        address spender,
        uint256 id,
        uint256 amount
    ) public virtual returns (bool) {
        allowance[msg.sender][spender][id] = amount;
        emit Approval(msg.sender, spender, id, amount);
        return true;
    }

    function setOperator(
        address operator,
        bool approved
    ) public virtual returns (bool) {
        isOperator[msg.sender][operator] = approved;
        emit OperatorSet(msg.sender, operator, approved);
        return true;
    }

    function cook(address realizer, BlueprintCall[] calldata calls) external {
        (FlashSession session, MainClue mainClue) = openFlashAccounting(
            realizer
        );

        uint256 len = calls.length;
        for (uint256 k = 0; k < len; k++) _flashCook(calls[k], session);

        closeFlashAccounting(mainClue, session);
    }

    function cook(BlueprintCall[] calldata calls) external {
        FlashSession session = getCurrentSession();

        uint256 len = calls.length;
        for (uint256 k = 0; k < len; k++) _flashCook(calls[k], session);
    }

    function _executeAction(
        BlueprintCall calldata call
    )
        internal
        returns (
            TokenOp[] memory mint_,
            TokenOp[] memory burn_,
            TokenOp[] memory give,
            TokenOp[] memory take
        )
    {
        // optimistically ask for execution
        (mint_, burn_, give, take) = IBlueprint(call.blueprint).executeAction(
            call.action
        );

        if (call.checksum != 0) {
            // we read mint, burn, give, take directly from returndata
            bytes32 expected = HashLib.hashActionResults();

            if (call.checksum != expected) revert InvalidChecksum();
        }
    }

    function _flashCook(
        BlueprintCall calldata call,
        FlashSession session
    ) internal {
        address blueprint = call.blueprint;

        bool checkApprovals;
        address sender = call.sender;
        if (sender == address(0)) {
            // no override
            sender = msg.sender;
        } else if (sender != msg.sender && !isOperator[sender][msg.sender]) {
            checkApprovals = true;
        }

        (
            TokenOp[] memory mint_,
            TokenOp[] memory burn_,
            TokenOp[] memory give,
            TokenOp[] memory take
        ) = _executeAction(call);

        (
            FlashUserSession senderSession,
            UserClue senderClue
        ) = initializeUserSession(session, sender);

        for (uint256 i = 0; i < mint_.length; i++) {
            senderClue = addUserCreditWithClue(
                senderSession,
                senderClue,
                HashLib.getTokenId(blueprint, mint_[i].tokenId),
                mint_[i].amount
            );
        }

        for (uint256 i = 0; i < burn_.length; i++) {
            uint256 tokenId = HashLib.getTokenId(blueprint, burn_[i].tokenId);
            uint256 amount = burn_[i].amount;

            if (checkApprovals) _decreaseApproval(sender, tokenId, amount);

            senderClue = addUserDebitWithClue(
                senderSession,
                senderClue,
                tokenId,
                amount
            );
        }

        if (blueprint != sender && (give.length != 0 || take.length != 0)) {
            (
                FlashUserSession blueprintSession,
                UserClue blueprintClue
            ) = initializeUserSession(session, blueprint);

            for (uint256 i = 0; i < give.length; i++) {
                uint256 id = give[i].tokenId;
                uint256 amount = give[i].amount;
                senderClue = addUserCreditWithClue(
                    senderSession,
                    senderClue,
                    id,
                    amount
                );
                blueprintClue = addUserDebitWithClue(
                    blueprintSession,
                    blueprintClue,
                    id,
                    amount
                );
            }

            for (uint256 i = 0; i < take.length; i++) {
                uint256 id = take[i].tokenId;
                uint256 amount = take[i].amount;

                if (checkApprovals) _decreaseApproval(sender, id, amount);

                senderClue = addUserDebitWithClue(
                    senderSession,
                    senderClue,
                    id,
                    amount
                );
                blueprintClue = addUserCreditWithClue(
                    blueprintSession,
                    blueprintClue,
                    id,
                    amount
                );
            }
            saveUserClue(blueprintSession, blueprintClue);
        }
        saveUserClue(senderSession, senderClue);
    }

    function credit(uint256 id, uint256 amount) external {
        FlashSession session = getCurrentSession();

        (
            FlashUserSession userSession,
            UserClue userClue
        ) = initializeUserSession(session, msg.sender);

        UserClue newUserClue = addUserDebitWithClue(
            userSession,
            userClue,
            id,
            amount
        );
        if (UserClue.unwrap(userClue) != UserClue.unwrap(newUserClue))
            saveUserClue(userSession, newUserClue);
        _mint(msg.sender, id, amount);
        emit Mint(msg.sender, id, amount);
    }

    function credit(TokenOp[] calldata ops) external {
        FlashSession session = getCurrentSession();

        (
            FlashUserSession userSession,
            UserClue userClue
        ) = initializeUserSession(session, msg.sender);

        uint256 len = ops.length;
        for (uint256 i = 0; i < len; i++) {
            TokenOp calldata op = ops[i];
            uint256 id = op.tokenId;
            uint256 amount = op.amount;
            userClue = addUserDebitWithClue(userSession, userClue, id, amount);
            _mint(msg.sender, id, amount);
        }
        saveUserClue(userSession, userClue);
    }

    // todo: is this function useful at all?
    function debit(uint256 id, uint256 amount) external {
        FlashSession session = getCurrentSession();

        (
            FlashUserSession userSession,
            UserClue userClue
        ) = initializeUserSession(session, msg.sender);

        UserClue newUserClue = addUserCreditWithClue(
            userSession,
            userClue,
            id,
            amount
        );
        if (UserClue.unwrap(userClue) != UserClue.unwrap(newUserClue))
            saveUserClue(userSession, newUserClue);
        _burn(msg.sender, id, amount);
    }

    // todo: is this function useful at all?
    function debit(TokenOp[] calldata ops) external {
        FlashSession session = getCurrentSession();

        (
            FlashUserSession userSession,
            UserClue userClue
        ) = initializeUserSession(session, msg.sender);

        uint256 len = ops.length;
        for (uint256 i = 0; i < len; i++) {
            TokenOp calldata op = ops[i];
            uint256 id = op.tokenId;
            uint256 amount = op.amount;
            userClue = addUserCreditWithClue(userSession, userClue, id, amount);
            _burn(msg.sender, id, amount);
            emit Burn(msg.sender, id, amount);
        }
        saveUserClue(userSession, userClue);
    }

    function mint(address to, uint256 tokenId, uint256 amount) external {
        _mint(to, HashLib.getTokenId(msg.sender, tokenId), amount);
        emit Mint(to, tokenId, amount);
    }

    function mint(address to, TokenOp[] calldata ops) external {
        uint256 len = ops.length;

        for (uint256 i = 0; i < len; i++) {
            //wrap the  loop in a body  block
            {
                uint256 id = HashLib.getTokenId(msg.sender, ops[i].tokenId);
                _mint(to, id, ops[i].amount);
                emit Mint(to, ops[i].tokenId, ops[i].amount);
            }
        }
    }

    function burn(uint256 tokenId, uint256 amount) external {
        _burn(msg.sender, HashLib.getTokenId(msg.sender, tokenId), amount);
        emit Burn(msg.sender, tokenId, amount);
    }

    function burn(TokenOp[] calldata ops) external {
        uint256 len = ops.length;

        for (uint256 i = 0; i < len; i++) {
            {
                uint256 id = HashLib.getTokenId(msg.sender, ops[i].tokenId);
                _burn(msg.sender, id, ops[i].amount);

                emit Burn(msg.sender, ops[i].tokenId, ops[i].amount); //Emitting in loops to prevent access denials
            }
        }
    }

    function updateTokenData(uint256 id, uint256 newAmount) internal {
        uint256 packedData = tokenStorage[id];
        // Logic to update the packed data
        tokenStorage[id] = (packedData & (1 << 255)) | newAmount; // Update packed data
    }
}

